CSandbergUI::CSandbergUI()
{
	framebuffer = 0;
	rot_stop = ROTSIZE/2;

	pl_name = 0;
	pl_entry = 0;
	
	sound_color = SOUND_ACTIVE_COLOR;
	network_color = NETWORK_INACTIVE_COLOR;
	load_color = LOAD_INACTIVE_COLOR;
}

CSandbergUI::~CSandbergUI()
{
	if (pl_name != NULL)
	{
		free(pl_entry);
	}

	if (pl_entry != NULL)
	{
		free(pl_entry);
	}
}

int CSandbergUI::Initialize(char *strCWD)
{	
	Log(LOG_LOWLEVEL, "Initialize:");

	// setup GU
	sceGuInit();

	sceGuStart(GU_DIRECT,::list);
	sceGuDrawBuffer(GU_PSM_8888,(void*)0,BUF_WIDTH);
	sceGuDispBuffer(SCR_WIDTH,SCR_HEIGHT,(void*)0x88000,BUF_WIDTH);
	sceGuDepthBuffer((void*)0x110000,BUF_WIDTH);
	sceGuOffset(2048 - (SCR_WIDTH/2),2048 - (SCR_HEIGHT/2));
	sceGuViewport(2048,2048,SCR_WIDTH,SCR_HEIGHT);
	sceGuDepthRange(0xc350,0x2710);
	sceGuScissor(0,0,SCR_WIDTH,SCR_HEIGHT);
	sceGuEnable(GU_SCISSOR_TEST);
	sceGuDepthFunc(GU_GEQUAL);
	sceGuEnable(GU_DEPTH_TEST);
	sceGuFrontFace(GU_CW);
	sceGuShadeModel(GU_SMOOTH);
	sceGuEnable(GU_CULL_FACE);
	sceGuEnable(GU_LIGHTING);
	sceGuEnable(GU_LIGHT0);
	sceGuFinish();
	sceGuSync(0,0);

	sceDisplayWaitVblankStart();
	sceGuDisplay(GU_TRUE);

	sceKernelDcacheWritebackAll();

	InitPL();
	InitFX();

	Log(LOG_LOWLEVEL, "Initialize: completed");
	return 0;
}

void CSandbergUI::Terminate()
{
	Log(LOG_INFO, "Terminate:");
	sceGuTerm();
	Log(LOG_INFO, "Terminate: completed");
}

