void CSandbergUI::RenderState(void)
{
static int rot = 0;

	sceGuEnable(GU_TEXTURE_2D);

	if (rot == ROTSIZE)
		rot = 0;

	// setup Play texture
	sceGuTexFunc(GU_TFX_MODULATE,GU_TCC_RGBA);
	sceGuTexImage(0,16,16,16,::bplay);
	sceGuAmbientColor(0xffffffff);
	sceGuAmbient(0xffffffff);

	/* Render Play button */
	sceGumMatrixMode(GU_MODEL);
	sceGumLoadIdentity();
	{
		ScePspFVector3 pos = { 	 0.0  + ::sintable[(rot+0)%ROTSIZE],
					-1.3,
					-3.0f + ::costable[(rot+0)%ROTSIZE]};
		sceGumTranslate(&pos);
	}
	sceGumDrawArray(GU_TRIANGLES,GU_TEXTURE_32BITF|GU_COLOR_8888|GU_VERTEX_32BITF|GU_TRANSFORM_3D,2*3,0,::play_button);

	// setup Stop texture
	sceGuTexImage(0,16,16,16,::bstop);
	/* Render Stop button */
	sceGumMatrixMode(GU_MODEL);
	sceGumLoadIdentity();
	{
		ScePspFVector3 pos = { 	 0.0  + ::sintable[(rot+ROTSIZE/2)%ROTSIZE],
					-1.3,
					-3.0f + ::costable[(rot+ROTSIZE/2)%ROTSIZE]};
		sceGumTranslate(&pos);
	}
	sceGumDrawArray(GU_TRIANGLES,GU_TEXTURE_32BITF|GU_COLOR_8888|GU_VERTEX_32BITF|GU_TRANSFORM_3D,2*3,0,::stop_button);

	sceGuDisable(GU_TEXTURE_2D);

	if (rot != rot_stop)
		rot++;
}

void CSandbergUI::RenderNetwork(void)
{
	sceGuEnable(GU_TEXTURE_2D);

	sceGuAlphaFunc(GU_GREATER,0,0xff);
	sceGuEnable(GU_ALPHA_TEST);

	// setup texture
	sceGuTexImage(0,32,32,32,::network);
	sceGuTexFunc(GU_TFX_MODULATE,GU_TCC_RGBA);

	struct Vertex* c_vertices = (struct Vertex*)sceGuGetMemory(2 * sizeof(struct Vertex));
	c_vertices[0].u = 0; c_vertices[0].v = 0;
	c_vertices[0].x = 480-40; c_vertices[0].y = 8; c_vertices[0].z = 0;
	c_vertices[0].color = network_color;
	c_vertices[1].u = 32; c_vertices[1].v = 32;
	c_vertices[1].x = 480-8; c_vertices[1].y = 8+32; c_vertices[1].z = 0;
	c_vertices[1].color = network_color;
	sceGuDrawArray(GU_SPRITES,GU_TEXTURE_32BITF|GU_COLOR_8888|GU_VERTEX_32BITF|GU_TRANSFORM_2D,2,0,c_vertices);

	sceGuDisable(GU_ALPHA_TEST);
	sceGuDisable(GU_TEXTURE_2D);
}

void CSandbergUI::RenderLoad(void)
{
	sceGuEnable(GU_TEXTURE_2D);

	sceGuAlphaFunc(GU_GREATER,0,0xff);
	sceGuEnable(GU_ALPHA_TEST);

	// setup texture
	sceGuTexImage(0,32,32,32,::load);
	sceGuTexFunc(GU_TFX_MODULATE,GU_TCC_RGBA);

	struct Vertex* c_vertices = (struct Vertex*)sceGuGetMemory(2 * sizeof(struct Vertex));
	c_vertices[0].u = 0; c_vertices[0].v = 0;
	c_vertices[0].x = 480-40; c_vertices[0].y = 48; c_vertices[0].z = 0;
	c_vertices[0].color = load_color;
	c_vertices[1].u = 32; c_vertices[1].v = 32;
	c_vertices[1].x = 480-8; c_vertices[1].y = 48+32; c_vertices[1].z = 0;
	c_vertices[1].color = load_color;
	sceGuDrawArray(GU_SPRITES,GU_TEXTURE_32BITF|GU_COLOR_8888|GU_VERTEX_32BITF|GU_TRANSFORM_2D,2,0,c_vertices);

	sceGuDisable(GU_ALPHA_TEST);
	sceGuDisable(GU_TEXTURE_2D);
}

void CSandbergUI::RenderSound(void)
{
	sceGuEnable(GU_TEXTURE_2D);

	sceGuAlphaFunc(GU_GREATER,0,0xff);
	sceGuEnable(GU_ALPHA_TEST);

	// setup texture
	sceGuTexImage(0,32,32,32,::sound);
	sceGuTexFunc(GU_TFX_MODULATE,GU_TCC_RGBA);

	struct Vertex* c_vertices = (struct Vertex*)sceGuGetMemory(2 * sizeof(struct Vertex));
	c_vertices[0].u = 0; c_vertices[0].v = 0;
	c_vertices[0].x = 480-40; c_vertices[0].y = 88; c_vertices[0].z = 0;
	c_vertices[0].color = sound_color;
	c_vertices[1].u = 32; c_vertices[1].v = 32;
	c_vertices[1].x = 480-8; c_vertices[1].y = 88+32; c_vertices[1].z = 0;
	c_vertices[1].color = sound_color;
	sceGuDrawArray(GU_SPRITES,GU_TEXTURE_32BITF|GU_COLOR_8888|GU_VERTEX_32BITF|GU_TRANSFORM_2D,2,0,c_vertices);

	sceGuDisable(GU_ALPHA_TEST);
	sceGuDisable(GU_TEXTURE_2D);
}
